INSERT INTO `tickets` (`ID`, `Username`, `Type`, `Status`, `Priority`, `Description`, `Date`) VALUES
(1, 'Delta_H_Striker', 'Probleme generale (legate de joc)', 1, 'Normala', 'is blocat!!!!!!!! e un bug la dmv!!\r\nfile:///C:/Users/Acer/Documents/GTA%20San%20Andreas%20User%20Files/SAMP/screens/sa-mp-012.png uite aici dovada ca nu te ocupi de sv!!!', '1588427584'),
(2, 'xYz', 'Probleme generale (legate de joc)', 1, 'Normala', 'Aici se poate vedea ceea ce am intrebat eu, si ce-a raspuns helperul. https://imgur.com/XiOOEsP', '1588428341'),
(3, 'FacDMptERARPG', 'Probleme generale (legate de joc)', 1, 'Normala', 'Primesti intre 50-250 pp uri (sau mai multe) la quest. am zis si in sms la xPaulFTW si pe chatul live-ului.', '1588428564'),
(4, 'AmpistAdv', 'Probleme generale (legate de joc)', 1, 'Foarte mare', 'Va rog nu imi mai stergeti ticket-ul, xPaul mi-a zis sa-l fac.\r\nDoresc si eu beneficiile de youtuber, dovada: https://imgur.com/a/8wqRdov\r\nAm postat si primul video, am deja parca 20 likes \r\n', '1588431295'),
(5, 'Edward', 'Probleme generale (legate de joc)', 1, 'Normala', 'Dece am 0.00 ore jucate ca aveam 1.50 de ore', '1588431752'),
(6, 'FacDMptERARPG', 'Raportare buguri', 1, 'Normala', 'Sugestie pentru job-ul Trucker. Puneti un delay de 15-30 secunde cand ajungi la checkpoint. Iti da acelasi checkpoint de 5-10 ori in acelasi loc si hackerii [Cei care folosesc Teleport-Hack] sa nu abuzeze[In caz ca da in alt loc].', '1588435094'),
(7, 'SlyRacon', 'Raportare buguri', 1, 'Scazuta', 'Cand dai /buylicenses si cumperi toate licentele, nu ti se pun realizarile la /realizari', '1588436225'),
(8, 'Edward', 'Probleme generale (legate de joc)', 1, 'Normala', 'vreau orele inapoi https://imgur.com/a/SrGNBG0', '1588440912'),
(9, 'SpioNul', 'Inselatorii (recuperare bunuri/altceva)', 1, 'Foarte mare', 'Mi s-au sters undele bunuri pe care le aveam: aveam un skin epic, o masina si 3.4kk https://imgur.com/undefined', '1588441033'),
(10, 'LuciDobre', 'Inselatorii (recuperare bunuri/altceva)', 1, 'Foarte mare', 'https://imgur.com/a/GeO4Qev\r\ninainte si dupa restart ', '1588442080'),
(11, 'FacDMptERARPG', 'Raportare buguri', 1, 'Normala', 'https://youtu.be/MNAPYHI3DkE -Bug. S-a dat bonus si la HUD nu se vede ce am primit la bonus, dar la /stats da.', '1588444421'),
(12, 'DrAgOnS2018', 'Inselatorii (recuperare bunuri/altceva)', 1, 'Normala', 'Inainte de restart aveam 29 de pp si 369 de gift points, ma poti ajuta cumva?', '1588444486'),
(13, 'FacDMptERARPG', 'Raportare buguri', 1, 'Normala', 'Cand dai /getgift si iti pica bani iti da doar 3.000.000$ fix.\r\nInainte cand am dat /stats: https://imgur.com/a/k5R6vGm\r\nDupa ce am castigat banii: https://imgur.com/a/oRLhay9\r\nSi dupa am mai dat /getgift, am castigat 7.788.897: https://imgur.com/a/PO7QLL9', '1588482447'),
(14, 'alex12345', 'Probleme generale (legate de joc)', 1, 'Scazuta', 'test', '1588490518'),
(15, 'Denis_Corrona12', 'Probleme generale (legate de joc)', 1, 'Scazuta', 'Dupa resetarea de azi mi s-au scazut din pp-uri,nu stiu cum sa dau poza', '1588496936'),
(16, 'Edward', 'Probleme generale (legate de joc)', 1, 'Normala', 'Am pierdut 13kk de la rollback vreau inapoi dovada  https://imgur.com/a/EPBLtRd', '1588512296'),
(17, 'GRANITE', 'Raportare buguri', 1, 'Normala', 'Am facut acest ticket pentru ca xPaulFTW mi-a spus sa  il fac.\r\nEu am raportat foarte muklte buguri bine nu chiar asa de multe.\r\nSi Paule ai spus sa fac ticket ca vr o recompensa.\r\nDovada ca Paul mi-a zis sa fac ticket :) :https://imgur.com/T86QAO3\r\nPaule vr recompensa  :)', '1588521116'),
(18, 'FcDarius', 'Probleme generale (legate de joc)', 1, 'Normala', 'Am primit wanted 6 pentru ca am mers pe contrasens', '1588527113'),
(19, 'AmpistAdv', 'Inselatorii (recuperare bunuri/altceva)', 1, 'Foarte mare', 'Dovada, vreau bunurile inapoi: https://imgur.com/a/6TeUEqb', '1588588604'),
(20, 'PnBogdan', 'Probleme generale (legate de joc)', 1, 'Mare', 'Aseara la ora 03:00 m-am delogat si aveam 70kk si un pcj, astazi nu mai am acei bani si nici motorul', '1588588747'),
(21, 'Optimum', 'Inselatorii (recuperare bunuri/altceva)', 1, 'Foarte mare', 'Am pierdut bunuri in urma restartului.\r\nhttps://imgur.com/a/UILEInC', '1588588891'),
(22, 'SlyRacon', 'Inselatorii (recuperare bunuri/altceva)', 1, 'Foarte mare', 'https://imgur.com/a/JoHpiRZ', '1588588900'),
(23, 'Zaki', 'Probleme generale (legate de joc)', 1, 'Scazuta', 'Salut, as dori si eu gradul de youtuber pe server daca se poate si beneficiile respective, https://www.youtube.com/watch?v=Pgk4X9rwX8w&t=28s, in afara de acestea inainte de acordarea rollback-ului aveam 19.48 ore jucate pe server si 28 de respect points pe server.', '1588588929'),
(24, 'FcDarius', 'Inselatorii (recuperare bunuri/altceva)', 1, 'Mare', 'mi-au disparut o parte din bunuri', '1588589078'),
(25, 'AcroniX', 'Probleme legate de securitatea conturilor', 1, 'Foarte mare', 'Nu mi se pare normal sa imi scada orele degeaba in pnm.Ieri aveam 6 ore azi am 4.49 nu mi se pare correct.Rezolvati ca nu vreau sa imi pierd sansa de a devenii lider pentru un bug care nu este rezolvat.Vreau sa mentionez ca la un payday de ieri nici macar nu am primit orele.Rezolvati odata ca nu este ok. ', '1588589835'),
(26, 'FacDMptERARPG', 'Probleme generale (legate de joc)', 1, 'Normala', 'Nu merge sa faci reclamatii pe panel. ionelALTau foloseste cheats, mai exact Fly-Hack. https://www.youtube.com/watch?v=q2IeWSwL3wg', '1588590216'),
(27, 'AmpistAdv', 'Probleme generale (legate de joc)', 1, 'Foarte mare', 'Beneficii pt live de 5 ore si un video\r\n      Dovada: https://imgur.com/a/z4rm5cZ', '1588590944'),
(28, 'Zaki', 'Probleme generale (legate de joc)', 1, 'Scazuta', 'https://www.youtube.com/watch?v=Pgk4X9rwX8w, Nu merge sa fac alt ticket, acesta este pentru youtube. Salut, doresc si eu beneficiile pentru youtube si gradul pe server, multumesc.', '1588591195'),
(29, 'andu22', 'Probleme generale (legate de joc)', 1, 'Mare', 'Ieri am avut 40 pp pentru ca am facut quest-ul special si a dat xpaul 24pp la job goal.\r\nAzi am intrat pe server si am facut special quest si quest-urile zilnice cand am dat stats aveam 12 pp care le-am primit de la quest special am vrt sa dau report doar ca nu era nimeni on.Apoi mi-am cumparat un skin rare si m-am dus la crate sa-mi cumpar niste crate-uri mi-am luat un crate epic si unul rar dupa ce le-am deschis crate-ul epic mi-a dat 2kk si cel rare 1kk si aveam in total 10kk.Apoi am iesit de pe sv si cand am intrat mi-a disparut si skinul rare si pp-urile si aveam 4kk.', '1588592774'),
(30, 'Zaki', 'Probleme generale (legate de joc)', 1, 'Scazuta', 'https://imgur.com/a/7DAX31i, + aveam 20 de ore si 23 de respect points.', '1588593797'),
(31, 'LemMoN', 'Probleme generale (legate de joc)', 0, 'Scazuta', 'Zaki mi-o dat blacklist in Politie \r\nhttps://cdn.discordapp.com/attachments/706818487078879264/706859954383880262/unknown.png\r\n', '1588598986');
